@use 'abstracts/' as *;

$elements: 12;
$elements-displayed: 4;
$animation-duration: calc($elements * 4s);

.carousel {
    background-color: $black;
    width: 100%;
    height: 52vh;
    overflow: hidden;
    padding: auto 0;
    position: relative;

    

    &__list {
        list-style: none;
        height: 100%;
        display: flex;
        animation: scrolling $animation-duration linear infinite;


        &__item {
            width: 40rem;
            flex-shrink: 0;
            white-space: nowrap;

            img {
                width: 40rem;
            }
        }
    }
}


@keyframes scrolling {
    0% {
        transform: translateX(0);
    }
    100% {
        transform: translateX(-1*30vw*$elements);
    }
}

